import React, { useEffect, useState } from "react";
import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Drawer,
  List,
  ListItem,
  ListItemText,
  useMediaQuery,
  useTheme,
} from "@mui/material";
import { Link } from "react-router-dom";
import { useAuth } from "../../components/context/AuthContextProvider";
import { ADMIN_EMAIL } from "../../helpers/const";
import MenuIcon from "@mui/icons-material/Menu";
import CloseIcon from "@mui/icons-material/Close";

// Импортируем стили
import "./Navbar.css"; // Убедитесь, что путь к файлу правильный

const Navbar = () => {
  const { user, handleLogOut, loading } = useAuth();
  const [isAdmin, setIsAdmin] = useState(false);
  const [drawerOpen, setDrawerOpen] = useState(false);

  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down("sm"));

  useEffect(() => {
    if (user) {
      setIsAdmin(user.email === ADMIN_EMAIL);
    }
  }, [user]);

  const pages = [
    { id: 1, title: "Атлеты", link: "/athletes" },
    { id: 2, title: "Виды спорта", link: "/sports" },
    { id: 3, title: "Медальный зачет", link: "/medal-table" },
  ];

  if (isAdmin) {
    pages.push({ id: 4, title: "Админ", link: "/admin" });
  }

  const toggleDrawer = (open) => {
    setDrawerOpen(open);
  };

  return (
    <div className="root">
      <AppBar position="static" className="appBar">
        <Toolbar className="toolbar">
          <div className="leftItems">
            <img
              src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/41/Flag_of_Kyrgyzstan_%283-2%29.svg/1599px-Flag_of_Kyrgyzstan_%283-2%29.svg.png?20240311163127"
              className="icon"
              alt="Flag"
            />
            <Link to={"/"} className="menuLink">
              <Typography variant="h6" className="menuItem">
                Спортсмены КР
              </Typography>
            </Link>
          </div>

          {!isMobile && (
            <div className="centerItems">
              {pages.map((page, index) => (
                <IconButton
                  key={page.id}
                  color="inherit"
                  component={Link}
                  to={page.link}
                  className="menuButton"
                >
                  <Typography variant="body1" className="menuItem">
                    {page.title}
                  </Typography>
                </IconButton>
              ))}
            </div>
          )}

          <div className="rightItems">
            <IconButton
              edge="end"
              color="inherit"
              aria-label="menu"
              onClick={() => toggleDrawer(true)}
              className="menuButton"
            >
              <MenuIcon />
            </IconButton>
          </div>
        </Toolbar>
      </AppBar>

      <Drawer
        anchor="right"
        open={drawerOpen}
        onClose={() => toggleDrawer(false)}
        className="drawer"
      >
        <div className="drawerHeader">
          <IconButton
            onClick={() => toggleDrawer(false)}
            className="closeButton"
          >
            <CloseIcon />
          </IconButton>
        </div>
        <List className="drawerList">
          {!loading && (
            <ListItem button>
              <Typography>
                {user
                  ? isAdmin
                    ? `Добро пожаловать, ${user.email}`
                    : `Добро пожаловать, ${user.displayName || user.email}`
                  : "Добро пожаловать, гость"}
              </Typography>
            </ListItem>
          )}
          {!loading && !user && (
            <ListItem button component={Link} to="/register">
              <ListItemText primary="Регистрация" />
            </ListItem>
          )}
          {!loading && user && (
            <ListItem button onClick={handleLogOut}>
              <ListItemText primary="Выйти" />
            </ListItem>
          )}
          {pages.map((page) => (
            <ListItem button key={page.id} component={Link} to={page.link}>
              <ListItemText primary={page.title} />
            </ListItem>
          ))}
        </List>
      </Drawer>
    </div>
  );
};

export default Navbar;
